import requests
import time

api_key = '04b7ce98fcf9fe24654962b649b09bef'
base64_image = 'data:image/jpeg;base64,'
img_instructions = 'Use the arrows to rotate the object to face in the direction of the hand'

def solve_base64_captcha():
	while True:
		# Send request to solve base64 captcha
		create_task_payload = {
			"clientKey": api_key,
			"task": {
				"type": "ImageToTextTask",
				"body": base64_image,
				"imgInstructions": img_instructions
			}
		}
		
		response = requests.post('http://api.pushon.me/createTask', json=create_task_payload)
		if response.status_code == 200 and response.json().get('errorId') == 0:
			print(response.json())
			task_id = response.json().get('taskId')
		else:
			print('Failed to submit captcha')
			continue

		# Check result
		result = None
		while not result:
			time.sleep(5)
			get_task_result_payload = {
				"clientKey": api_key,
				"taskId": task_id
			}
			res = requests.post('http://api.pushon.me/getTaskResult', json=get_task_result_payload)
			if res.status_code == 200 and res.json().get('status') == 'ready':
				print(res.json())
				result = res.json().get('solution').get('text')
				return result
			elif res.json().get('status') == 'processing':
				print('Captcha not ready yet')
			else:
				print('Failed to get captcha result')
				break

# Run the function to solve base64 captcha and print the result token
result_token = solve_base64_captcha()
if result_token:
	print(result_token)